import Logo from '../Attachments/Image/Logo.jpg';
import { AiOutlineMessage } from 'react-icons/ai';

export const Database = {
  NavbarData: {
    navigateList: [
      {
        title: "Beranda",
        link: "/",
      },
      {
        title: "Layanan",
        link: "/Service",
      },
      {
        title: "Tentang",
        link: "/About",
      },
      {
        title: "Tim",
        link: "/Team",
      },
    ],

    logo: Logo,

    button: {
      icon: <AiOutlineMessage />,
      title: "Hubungi Kami",
    },
  },
  HomeData: {
    page_1: {
      title: "Penuhi semua kebutuhan investigasi dan litigasi Anda",
      subtitle:
        "Kantor Hukum kami terdiri dari tim advokat & legal consultant mempunyai berintegritas yang mampu dan berpengalaman menangani berbagai perkara hukum.",
      button: [
        {
          link: "/Service",
          title: "Layanan Kami",
        },
        {
          link: "/Contact",
          title: "Kontak Kami",
        },
      ],
    },

    page_2: {
      title: "Tentang Kami",
      subtitle:
        "Kantor Hukum kami terdiri dari tim advokat & legal consultant mempunyai berintegritas yang mampu dan berpengalaman menangani berbagai perkara hukum. Pendekatan yang digunakan dalam menyelesaikan setiap masalah selalu berpedoman pada Undang - Undang dan Ketentuan Hukum yang mengatur pada setiap bidang. Selain itu kami juga memberikan pelatihan kepada advokat maupun masyarakat tentang hukum. ",
      button: {
        link: "/Service",
        title: "Layanan Kami",
      },
    },
  },
};
